Swim Fast! Series -- Breastroke According to Moses!

Glenn Edward (&quot;Ed&quot;) Moses, Jr. formula for success:
NT (natural talent) + WE (unparalleled work ethic) + A (constant analysis = 3G (gold medals)

Only 5'11&quot;, he began swimming full-time in his senior year of high school.

American record setter &amp; 7 times national champion.

Pan Am Games gold medal winner in 100 meter breaststroke. 

Won gold and silver medals at 2000 Olympics.

World record setter for 100 and 200 meter (short-course) breaststroke plus 4 x 100 medley relay. Short-course means he knows his turns as well as his breastroke.

Has a degree in sports medicine.

His training secret -- the 10-pound medicine ball.

Never busted for DUI and never photographed smoking a bong.

Yeah, I'd say he is worth listening to and observing.

Any DVD Converter split this into two files and combining them into one with WinAVI caused a substantial loss in quality so I've kept the two files and put them in a folder zipped with WinRAR. Nothing else added to the folder, no ads, no links, no promo, no nothin -- just Ed Moses.

